import React from 'react';
import './App.css';
import './styles.css';
import Counter from './components/Counter';
import CounterSS from './components/CounterSS';
import Monitor from './components/Monitor';
import ApiCaching from './components/ApiCaching';

function App() {
  return (
    <div className="main-app-container">
      <div className="sticky-header">
        <h1 className="main-title">Redis Demo</h1>
        <Monitor />
        <div style={{ width: '100%' }}>
          <hr className="main-separator" />
        </div>
      </div>

      <div className="scrollable-content">
        <div className="app-container">
          <div className="main-content">
            <sectionComponent title="Counter with String" component={<Counter />} />
            <sectionComponent title="Counter with Sorted Set" component={<CounterSS />} />
            <sectionComponent title="API Caching" component={<ApiCaching />} />
          </div>
        </div>
      </div>
    </div>
  );
}

const sectionComponent = ({ title, component }) => (
  <div className="main-component-section">
    <h1 className="main-component-title">{title}</h1>
    {component}
    <div style={{ width: '100%', display: 'flex', justifyContent: 'flex-start' }}>
      <hr className="main-separator" />
    </div>
  </div>
);

export default App;
